CREATE PROCEDURE loop_insert()
BEGIN    
    DECLARE i INT DEFAULT 1;

    WHILE i <= 150 DO
INSERT INTO testBinary ( id, name, colBinary ) VALUES ( 4, 'name4', 0x12345 );
        SET i = i + 1;
    END WHILE;
END

